import styled from "styled-components";

const CheckOutSome = styled.div`
  position: absolute;
  top: 0px;
  left: 0px;
  font-size: var(--font-size-21xl);
  line-height: 48px;
  font-weight: 600;
  display: inline-block;
  width: 525px;
`;
const FrameChild = styled.div`
  position: absolute;
  top: 152px;
  left: 0px;
  border-radius: var(--br-9xs);
  background: linear-gradient(143.23deg, #fa485e, #fb6645);
  width: 32px;
  height: 32px;
`;
const FrameItem = styled.div`
  position: absolute;
  top: 260px;
  left: 0px;
  border-radius: var(--br-9xs);
  background: linear-gradient(143.23deg, #fa485e, #fb6645);
  width: 32px;
  height: 32px;
`;
const FrameInner = styled.div`
  position: absolute;
  top: 368px;
  left: 0px;
  border-radius: var(--br-9xs);
  background: linear-gradient(143.23deg, #fa485e, #fb6645);
  width: 32px;
  height: 32px;
`;
const RectangleDiv = styled.div`
  position: absolute;
  top: 476px;
  left: 0px;
  border-radius: var(--br-9xs);
  background: linear-gradient(143.23deg, #fa485e, #fb6645);
  width: 32px;
  height: 32px;
`;
const TextToSpeech = styled.div`
  position: absolute;
  top: 152px;
  left: calc(50% - 218.5px);
  line-height: 28px;
  font-weight: 600;
  display: inline-block;
  width: 247.38px;
`;
const GetDiscount = styled.div`
  position: absolute;
  top: 260px;
  left: calc(50% - 218.5px);
  line-height: 28px;
  font-weight: 600;
  display: inline-block;
  width: 247.38px;
`;
const MakeAPlan = styled.div`
  position: absolute;
  top: 368px;
  left: calc(50% - 218.5px);
  line-height: 28px;
  font-weight: 600;
  display: inline-block;
  width: 247.38px;
`;
const DarkMode = styled.div`
  position: absolute;
  top: 476px;
  left: calc(50% - 218.5px);
  line-height: 28px;
  font-weight: 600;
  display: inline-block;
  width: 247.38px;
`;
const LoremIpsumIs = styled.div`
  position: absolute;
  top: 188px;
