  display: inline-block;
  width: 304px;
`;
const LoremIpsumIs2 = styled.div`
  position: absolute;
  top: 404px;
  left: calc(50% - 218.5px);
  font-size: var(--font-size-base);
  line-height: 24px;
  display: inline-block;
  width: 304px;
`;
const LoremIpsumIs3 = styled.div`
  position: absolute;
  top: 512px;
  left: calc(50% - 218.5px);
