  color: var(--off-black);
  font-family: var(--font-rubik);
`;
const FeatureCard: FunctionComponent = () => {
  return (
    <CheckOutSomeOfOurAmazingParentRoot>
      <CheckOutSome>Check out some of our amazing features</CheckOutSome>
